import React from "react"
import {GoogleLogin} from "react-google-login"

const clientId = "687510174429-stq4gsnugh62mq0joeb0apsfnmcvcpm5.apps.googleusercontent.com"

function Login(){

    function onSuccess(res){
        console.log(`[Login Success] currentUser: ${res.profileObj}`)
    }

    const LoginFailure = (response) => {
        console.log(response)
        swal('Login fail')
    }

    return(
        <div>
            <GoogleLogin clientId={clientId} buttonText="Login" onSuccess={onSuccess}
            onFailure={LoginFailure} cookiePrivacy={"single_host_origin"} isSignedIn={true} />
        </div>
    )
}

export default Login;
